import React from 'react'
import './Home.css'
import { useTypewriter , Cursor} from 'react-simple-typewriter'


export const Home = () => {
  const [text] = useTypewriter({
    words: ['Front-end Developer', 'UI UX', 'Web Designer'],
    loop:{},
    typeSpeed: 120,
    deleteSpeed: 50
  });

  return (
    <div className='home-container'>
      <div className='Name' >I am Yaman Ajlouni
        <div className='special'>
          I'm
          <span>{text}</span>
        </div>
      </div>
    </div>

  )
}
